import React from "react";
import { Card } from "../../Card.styled";
const Grid3 = ({ content }) => {
  return (
    <Card bd={"1px solid red"}>
      <Card
        dp={"grid"}
        gridR={"33% 33% 33%"}
        height={"10rem"}
        mg={"10rem 0% 0% 0%"}
        bd={"1px solid blue"}
      >
        <Card bd={"1px solid blue"}>
          <Card fs={"1.5rem"}>
            <b>12.1K+</b>
          </Card>
          <Card>Artwork</Card>
        </Card>
        <Card bd={"1px solid blue"}></Card>
        <Card bd={"1px solid blue"}></Card>
      </Card>
    </Card>
  );
};

export default Grid3;
